import React, { Component } from "react";
import { Link, Nav } from "react-router-dom";

export default class Navbar extends Component {
    render() {
        return (
            <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">Navbar</Navbar.Brand>
    <Nav className="mr-auto">
    <Link class="navbar-brand" href="#">Exercise App</Link>
    <Link class="nav-link" to="/">Exercise Tracker <span class="sr-only">(current)</span></Link>
    <Link class="nav-link" to="/">Exercises <span class="sr-only">(current)</span></Link>
    <Link class="nav-link" to="/create">Create Exercise Log <span class="sr-only">(current)</span></Link>
    <Link class="nav-link" to="/user">Create User <span class="sr-only">(current)</span></Link>
    </Nav>
  </Navbar>


                  )
    }
}
